import React, { Component } from 'react'

export class PreInformation extends Component {

    render() {
        return (


            this.props.history ? <div id="পূর্বের তথ্য" className="tab-pane">
                {this.props.history.outlet_number}
            </div> : null
        )
    }
}

export default PreInformation
